-spec number_of_good_partitions(Nums :: [integer()]) -> integer().
number_of_good_partitions(Nums) ->
    Mod = 1000000007,
    lists:foldr(
        fun(X, {Prev, Map, Res}) ->
            {X, [{X, 1} | Map], (Res + Prev) rem Mod}
        end,
        {none, [], 0},
        Nums
    )::{_, _, Result}.
